import re
import csv

def extract_all_names_and_coordinates(text):
    pattern = r'\["الاسم",\[\"(.*?)\"\].*?\[\[\[(.*?),(.*?)\]\]\]'
    matches = re.findall(pattern, text)

    data = []
    for match in matches:
        name = match[0]
        coordinates = (float(match[1]), float(match[2]))
        data.append((name, coordinates))

    return data

